public void create(boolean _append = false)
{
    if (!journalFormController.tableDatasourceCreatePre())
    {
        return;
    }
    // Do not call super() - the method above will insert the new record

    journalFormController.tableDatasourceCreatePost();
}

public int active()
{
    int ret = super();

    element.enableJournalLineButtons();
    InventJournalTable::setInventJournalUnlockButtonProperties(InventJournalUnlockButton, InventJournalTable.SystemBlocked, InventJournalTable.Posted);

    return ret;
}

public boolean validateWrite()
{
    boolean ret;

    inventJournalTrans.InventDimId = InventDim::findOrCreate(inventDimIssue).InventDimId;
    inventJournalTrans.ToInventDimId = InventDim::findOrCreate(inventDimReceipt).InventDimId;

    ret = super();

    return ret;
}

public void write()
{
    try
    {
        inventJournalTrans.ToInventDimId  = InventDim::findOrCreate(inventDimReceipt).InventDimId;

        ttsbegin;

        super();

        if (inventjournalTrans.ToInventDimId != inventDimReceipt.InventDimId)
        {
            inventDimReceipt.data(InventDim::find(inventJournalTrans.ToInventDimId));
            inventDimReceipt_ds.setCurrent();
        }

        ttscommit;
    }
    catch (Exception::Error)
    {
        if (!inventJournalTrans.RecId)
        {
            inventJournalTrans.InventTransId = '';
            inventJournalTrans.ToInventTransId = '';
        }
        throw Exception::Error;
    }
}

public int active()
{
    int ret = super();

    inventDimReceipt_ds.active();

    InventTransProductionBOMConsignment.enabled(InventTransOriginProdBomOwnershipChangeJournalTransLink::existByOwnershipChangeJournalLine(inventJournalTrans.RecId));

    return ret;
}

public void modified()
{
    if (inventJournalTrans.PdsCWQty > 0)
    {
        inventJournalTrans.PdsCWQty = -inventJournalTrans.PdsCWQty;
    }

    super();
}

public void modified()
{
    super();
    inventDimReceipt_ds.object(fieldNum(InventDim, InventStatusId))
        .setValue(inventDimIssue_ds.object(fieldNum(InventDim, InventStatusId)).getValue());
}

public void init()
{
    super();

    var journalFormTrans = journalFormController.parmInventJournalFormTrans_Movement();
    journalFormTrans.inventDimReceiptInitPost(inventDimReceipt);

    #DEFINE.DataSourceReceipt(3)
    QueryBuildDataSource qb = this.query().dataSourceNo(#DataSourceReceipt);
    qb.clearLinks();
    qb.addLink(fieldNum(InventJournalTrans,ToInventDimId),fieldNum(InventDim,InventDimId));
}

public void initFromItemInventDimIssue()
{
    InventDim tmpDim;

    EcoResProductDimGroupSetup::copyProductDimensionsForItem(inventJournalTrans.ItemId, inventDimIssue, tmpDim);
    inventDimReceipt.data(tmpDim);
    inventDimReceipt.write();
}
